import React from 'react'
import styled from 'styled-components'
const Home2 = () => {
  return (
    < Wrapper  className='test'>Home2</ Wrapper> 
  )
}
const Wrapper = styled.section`
background-color: ${({ theme}) => theme.colors.bg}; 
width: 200rem
height: 20rem;
`;
export default Home2
